import React from 'react';
import map from './mapOfLocations.png';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={map} className="App-mapOfLocations" alt="mapOfLocations"/>
        <p>
          Select the companies you plan to visit!
          <select>
            <option value="grapefruit">Grapefruit</option>
            <option value="lime">Lime</option>
            <option selected value="coconut">Coconut</option>
            <option value="mango">Mango</option>
          </select>
        </p>
      </header>

    </div>
  );
}

export default App;
